import json
import time

import requests


def push_event(data: dict, headers: dict, server: str, port: str):
    return requests.post(
        url="{}:{}/event-server/api/v1/msg/push-event".format(server, port),
        headers=headers,
        json=data
    )


def concurrency_push_event(did: str):
    headers = {"Content-Type": "application/json"}
    timestamp = int(time.time())
    data_dict = {'eventTime': timestamp * 1000, 'deviceTime': timestamp, 'type': '100', 'channel': 1,
                 'did': did,
                 'data': {}, 'otherContent': '(null)'}
    data = {"pushData": json.dumps(data_dict, indent=4, sort_keys=True, ensure_ascii=False),
            "picture": "data:image/jpeg;base64,"
                       ""
            }
    # res = push_event(headers=headers, data=data, server="http://p6smessage-cn-cs.p6sai.com", port="8089")
    res = push_event(headers=headers, data=data, server="http://192.168.1.226", port="8082")
    return res


